{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"},"kaggle":{"accelerator":"none","dataSources":[{"sourceId":7715787,"sourceType":"datasetVersion","datasetId":4506183}],"dockerImageVersionId":30618,"isInternetEnabled":true,"language":"r","sourceType":"notebook","isGpuEnabled":false}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/fernrey45/caso-practico-an-lisis-de-datos?scriptVersionId=164607290\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","source":"**Caso práctico 1: ¿Cómo lograr el éxito rápido de un negocio de bicicletas compartidas?**\n\nComo Analista de Datos Junior se me ha dado la tarea de responder las preguntas iniciales del proyecto y orientativas para darle forma al proyecto, para ello identifico primeramente el punto principal, ¿Cómo lograr un súbito éxito de la compaña de bicicletas? Bueno, el tema es que analistas financieros descubrieron la rentabilidad de los ciclistas que son miembros anuales, ya que generan un gran ingreso a la empresa. Así que tomando esto podemos notar nuestra principal tarea que es transformar a los ciclistas ocasionales en miembros de nuestros servicios.\n\nPasamos entonces a describir los datos, estos datos fueron datos fueron obtenidos de un repositorio ubicado en Amazon Web Services, se encuentran comprimidos en formato *.zip*, ordenados en un archivo por cada mes, por lo cual son confiables en el sentido de que nadie sin autorización puede acceder y cambiar estos datos, originales e integrales son porque se calculan cada que alguien realiza solicitud de estos servicios, por lo que es un registro de datos, actuales también son porque se sitúan entre los últimos 12 meses, de Enero a Diciembre del año 2023 y no necesitan ser citados ya que son de fuente primaria. Así que son datos con alta credibilidad.\n\nDescargamos entonces los datos 12 meses de datos que fueron almacenados encarpetas y las alojaremos en carpetas divididas dentro de una carpeta principal, esto 2 veces ya que tenemos que contar con una copia por si dañamos los datos o el archivo lo modificamos incorrectamente.\n\n![image.png](attachment:c4abcd70-5d34-4711-86b2-48d1b7086d90.png)","metadata":{},"attachments":{"c4abcd70-5d34-4711-86b2-48d1b7086d90.png":{"image/png":""}}},{"cell_type":"markdown","source":"Pasamos entonces a la herramienta que usaremos para el procesamiento y análisis, que en este caso por su facilidad de uso y herramientas todo en un mismo lugar será R. Primeramente iniciaremos el ambiente en RStudio. Tras haber abierto la herramienta, cargaremos los archivos a la carpeta del proyecto.\n![image.png](attachment:646c5916-d125-4710-86c9-88214ca6f099.png)","metadata":{},"attachments":{"646c5916-d125-4710-86c9-88214ca6f099.png":{"image/png":""}}},{"cell_type":"code","source":"#Instalaremos en principio las librerías con:\ninstall.packages(\"tidyverse\")\ninstall.packages(\"ggplot2\")\ninstall.packages(\"lubridate\") \n#Todas estas librerias son las que usaremos para la representación y la manipulación de los datos","metadata":{"execution":{"iopub.status.busy":"2024-02-27T21:52:04.901857Z","iopub.execute_input":"2024-02-27T21:52:04.905072Z","iopub.status.idle":"2024-02-27T21:52:05.053193Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#Cargamos entonces las librerías\nlibrary(tidyverse)\nlibrary(lubridate)\nlibrary(ggplot2)\n#Una vez tengamos en nuestro ambiente los archivos, crearemos variables dentro del ambiente para referirnos a estas:\nm1_2023 <- read_csv(\"202301-divvy-tripdata.csv\")\nm2_2023 <- read_csv(\"202302-divvy-tripdata.csv\")\nm3_2023 <- read_csv(\"202303-divvy-tripdata.csv\")\nm4_2023 <- read_csv(\"202304-divvy-tripdata.csv\")\nm5_2023 <- read_csv(\"202305-divvy-tripdata.csv\")\nm6_2023 <- read_csv(\"202306-divvy-tripdata.csv\")\nm7_2023 <- read_csv(\"202307-divvy-tripdata.csv\")\nm8_2023 <- read_csv(\"202308-divvy-tripdata.csv\")\nm8_2023 <- read_csv(\"202308-divvy-tripdata.csv\")\nm9_2023 <- read_csv(\"202309-divvy-tripdata.csv\")\nm9_2023 <- read_csv(\"202309-divvy-tripdata.csv\")\nm10_2023 <- read_csv(\"202310-divvy-tripdata.csv\")\nm11_2023 <- read_csv(\"202311-divvy-tripdata.csv\")\nm12_2023 <- read_csv(\"202312-divvy-tripdata.csv\")","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"Necesitamos que los nombres de las columnas sean iguales para que al momento de unificarlos en un archivo, estas se coloquen donde les corresponde, para ello vamos a verificar que los nombres sean iguales con la función **colnames()**, que nos desplegará una lista con los nombres de las columnas.\n","metadata":{}},{"cell_type":"code","source":"#Para verificar las columnas\ncolnames(m1_2023)\ncolnames(m2_2023)\ncolnames(m3_2023)\ncolnames(m4_2023)\ncolnames(m5_2023)\ncolnames(m6_2023)\ncolnames(m7_2023)\ncolnames(m8_2023)\ncolnames(m9_2023)\ncolnames(m10_2023)\ncolnames(m11_2023)\ncolnames(m12_2023)","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"Después de examinar minuciosamente los nombres de las columnas, en caso de que sea necesario cambiar los nombres necesitaríamos usar la función “rename()”, de no ser así pasamos a buscar incongruencias con tipos de datos o con nombres incorrectos con la función “str()”, esto para cada variable del ambiente. En caso de ser necesario cambiar el tipo de dato, podemos hacerlo mediante la función “mutate([Variable],[columna_nombre] = as.character[columna_modificar])”. ","metadata":{}},{"cell_type":"code","source":"#Por último, para crear un dataset completo utilizaremos la siguiente función\nall_year_trips <- bind_rows(m1_2023,m2_2023,m3_2023,m4_2023,m5_2023,m6_2023,m7_2023,m8_2023,m9_2023,m10_2023,m11_2023,m12_2023)\n#Esta función junta todas las filas y las convierte en un solo conjunto de datos completo.","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"Ahora que contamos con la tabla con todos los datos, pasaremos a inspeccionarlo, primero con nombres de columnas para verificar que no haya repetidas, numero de filas y columas (son 5,719,877 filas con 13 columnas). Como parte del proceso de limpieza y agregación de datos, agregaremos columnas nuevas para determinar la distancia del recorrido, agregando una nueva columna que se llama “ride_length” y dándole formato numérico para poder hacer cálculos y manipulación con este.","metadata":{}},{"cell_type":"code","source":"#Estas son las columnas que pudieramos utilizar para un análisis más detallado\nall_year_trips$date <- as.Date(all_year_trips$started_at) #Convierte en formato fecha la columna\nall_year_trips$month <- format(as.Date(all_year_trips$started_at),\"%m\") #Crea una columna nueva y le da formato de solo mes\nall_year_trips$day <- format(as.Date(all_year_trips$started_at),\"%d\") #Crea una columna nueva y le da formato de solo día\nall_year_trips$year <- format(as.Date(all_year_trips$started_at),\"%Y\") #Crea una columna nueva y le da formato de solo año\nall_year_trips$day_of_week <- format(as.Date(all_year_trips$started_at),\"%A\") #Crea una columna nueva y le da formato de solo día de la semana\nall_year_trips$ride_length <- difftime(all_year_trips$ended_at,all_year_trips$started_at) #Crea una columna nueva mediante la formula de resta\n#Cambiaremos el tipo de dato de la columna ride_length para poder hacer operaciones con este\nis.difftime(all_year_trips$ride_length) #verificar el tipo de dato\nall_year_trips$ride_length <- as.numeric(all_year_trips$ride_length) #cambiarlo a numerico","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"Una vez hecho esto, notamos en la tabla que hay valores negativos en la columna “ride_length”, por lo que debemos deshacernos de estas filas que no nos sirven para el análisis. Para ello crearemos un subconjunto de datos, en el que indicaremos que estos deberán ser mayores a cero. Esto creando una nueva variable del entorno y utilizando la función “subset()”.","metadata":{}},{"cell_type":"code","source":"all_year_trips_v2 <- subset(all_year_trips,ride_length>0)\n\n#Ahora vamos a ver un resumen de todo la última columna\nsummary(all_year_trips_v2)","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#Ahora buscaremos las comparativas entre los usuarios casales con miembros, obteniendo el promedio, media, máximo y mínima en segundos:\naggregate(all_year_trips_v2$ride_length~all_year_trips_v2$member_casual,FUN=mean)\naggregate(all_year_trips_v2$ride_length~all_year_trips_v2$member_casual,FUN=median)\naggregate(all_year_trips_v2$ride_length~all_year_trips_v2$member_casual,FUN=max)\naggregate(all_year_trips_v2$ride_length~all_year_trips_v2$member_casual,FUN=min)","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"Haciendo pausa al proceso notemos cómo es que los números de minutos de los usuarios casuales son mucho mayores que los propios miembros, mas que nada por que no tenemos tantas suscripciones y es algo que queremos mejorar. Continuemos con el análisis haciendo una operación que obtenga una lista ordenada de los días y agrupe a los usuarios casuales y los miembros, dándonos el promedio del ride_length (tabla que muestra un resumen por día de la semana del promedio de la distancia recorrida según si es usuario casual o miembro)","metadata":{}},{"cell_type":"code","source":"#Vemos cómo el código de por si arreglará el orden, dandonos primero los días Domingo, Lunes, Martes, y así sucesivamente; buscando adempas la media\nall_year_trips_v2$day_of_week <- ordered(all_year_trips_v2$day_of_week,levels=c(\"Sunday\",\"Monday\",\"Tuesday\",\"Wednesday\",\"Thursday\",\"Friday\",\"Saturday\"))\naggregate(all_year_trips_v2$ride_length~all_year_trips_v2$member_casual + all_year_trips_v2$day_of_week,FUN=mean)","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"Como siguiente paso los reordenaremos, primero definiremos la columna “weekday” que será el día de la semana según el la columna “started_at”, después reagruparemos según si es usuario casual o miembro, resumiremos el número de viajes y el duración promedio y arreglaremos las columnas para que primero muestre la columna member_casual y luego weekday","metadata":{}},{"cell_type":"code","source":"all_year_trips_v2 %>% \n    mutate(weekday = wday(started_at,label=TRUE)) %>% \n    group_by(member_casual,weekday) %>% \n    summarise(number_of_rides = n(),average_duration = mean(ride_length)) %>% \n    arrange(member_casual,weekday)","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"Como podemos ver, se muestran los días de la semana y los miembros agrupados para solamente mostrar dos valores según el día de la semana, el cual es el numero de viajes y la duración promedio de los viajes. Y como veremos después mas a detalle en las tablas, podemos notar que el número de viajes es mayor en los miembros, pero la duración promedio es mucho mayor con los usuarios casuales.","metadata":{}},{"cell_type":"code","source":"#Por último, pasemos a las visualizaciones, comenzando por la visualizacion del número de viajes\nall_year_trips_v2 %>% \n    mutate(weekday = wday(started_at,label=TRUE)) %>% #Obtiene los días de la semana según la columna started_at\n    group_by(member_casual,weekday) %>%  #Agrupa los datos según si es miembro o casual, y los días de la semana\n    summarise(number_of_rides = n(),average_duration = mean(ride_length)) %>%  #Crea el dato de numeros de viajes que serán n() y la duración promedio con mean()\n    arrange(member_casual,weekday) %>% #cambia el orden de las columnas\n    ggplot(aes(weekday,number_of_rides,fill=member_casual))+geom_col(position = \"dodge\") #crea la visualizacion con x=weekday y y=number_of_rides, llenandolo según el usuario y siendo un gráfico de columnas","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#Similar al anterior gráfico, pero este cambia el valor para las \"y\", siendo este la duración promedio\nall_year_trips_v2 %>% \n    mutate(weekday = wday(started_at,label=TRUE)) %>% \n    group_by(member_casual,weekday) %>% \n    summarise(number_of_rides = n(),average_duration = mean(ride_length)) %>% \n    arrange(member_casual,weekday) %>% \n    ggplot(aes(weekday,average_duration,fill=member_casual))+geom_col(position = \"dodge\") #crea la visualizacion con x=weekday y y=average_duration, llenandolo según el usuario y siendo un gráfico de columnas","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"Si hablamos de duración promedio, podemos notar la gran superioridad de los usuarios casuales que los usuarios miembros, lo cual tiene sentido ya que hay mas usuarios casuales y es mas normal el rentar una bicicleta como usuario normal.\n\n![image.png](attachment:7c3b29bd-398a-4f30-91fb-26801155c8e8.png)","metadata":{},"attachments":{"7c3b29bd-398a-4f30-91fb-26801155c8e8.png":{"image/png":""}}},{"cell_type":"markdown","source":"Seguimos entonces con el número de viajes, como podemos notar es superior que los miembros hagan mas uso de la suscripción que los usuarios casuales rentar la bicicleta.\n\n![image.png](attachment:9778f363-f0e1-4d34-8032-b2fd660c601d.png)","metadata":{},"attachments":{"9778f363-f0e1-4d34-8032-b2fd660c601d.png":{"image/png":""}}},{"cell_type":"markdown","source":"Por último, ya que obtuvimos estas representaciones puedo mencionar algunos hallazgos:\n* Los fines de semana hay una alta cantidad de viajes por bicicleta por ambos tipos de usuario\n* Los usuarios casuales tienen mucho menor cantidad entre semana y los miembros cuentan con una cantidad promedio, exceptuando fines de semana que son menos concurridos.\n* La cantidad de tiempo de los usuarios miembros es corta a comparación de los usuarios casuales y es regular su uso, es decir, no varía mucho en todo el año el tiempo según el día.\n","metadata":{}},{"cell_type":"markdown","source":"**Nota:**\nComo fuentes para los conjuntos de datos, los he sacado de esta fuente: https://divvy-tripdata.s3.amazonaws.com/index.html. Bajo esta licencia: https://www.divvybikes.com/data-license-agreement","metadata":{}}]}